import React from 'react';
import ManagementPanel from './ManagementPanel';  // Assuming you create this subcomponent

function MainContent() {
  return (
    <main>
      <section className="widgets">
        <div className="widget">Open Incidents</div>
        <div className="widget">Resolved Incidents</div>
        <div className="widget">Escalations</div>
        <div className="widget">Notifications</div>
      </section>
      <ManagementPanel />  // Render subcomponent for managing incidents
    </main>
  );
}

export default MainContent;
